@socketio.on('bitmap')
def handle_message(data):
    d = data['data']
    message_bytes = d.encode('Ascii')
    today = datetime.now()
    name = "new"  + ".png"
    with open(name, "wb") as fh:
     print("conversion")
     fh.write(base64.decodebytes(message_bytes))
     reco(name)



